import React from 'react';
import "./Home.css";
import { BsBuilding } from "react-icons/bs";
import 'font-awesome/css/font-awesome.min.css';

const Home = () => {
    return (
        <div className="bg-img">
            <form action="" class="container">
            <div class="input-icons">
                <input type="text" placeholder="To"  name="From" required /><span><h3><BsBuilding /></h3></span>
                <input type="text" placeholder="From" name="to" BsBuilding required></input><span><h3><BsBuilding /></h3></span>
            </div>
                <input type="date" id="date" name="date" placeholder="Date" required></input>
                <input type="button" class="btn" value="Search Buses" required></input>
            </form> 
        </div>         
    )
}

export default Home;
